import { useEffect, useState } from "react"

export default function User(){

    const [meals,set]=useState([])

    console.log(meals)

    useEffect(()=>{
        fetch('http://localhost:8000/getmeals',{
            headers:{
                'auth-token':localStorage.getItem('auth-token')
            }
        }).then(data=>data.json()).then(data=>set(data))
    },[])

    return(
<>
        {localStorage.getItem('auth-token') &&

        meals.length!==0 && meals.map((elem,index)=><table class="table">
        <thead>

        </thead>
        <tbody>
          <tr class="table-active">
            ...
          </tr>
          <tr>
            ...
          </tr>
          <tr>
            <th scope="row">1</th>
            <td colspan="2" class="table-active">{elem.allmeals.title}</td>
            <td>{elem.allmeals.content}</td>
          </tr>
        </tbody>
      </table>)}
        {!localStorage.getItem('auth-token') &&

        <div >You need to login first</div>}

        </>

    )
}
